import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet,Image, Text, View ,ImageBackground, Button, Alert, Modal } from 'react-native';


const image={uri:"https://reactjs.org/logo-og.png"};
const image2={uri:"https://reactnative.dev/docs/assets/p_cat2.png"};
export default function App() {

  // const imagesrc2={"Aquaman.jpg"};
  return (
    <View style={[styles.container, {flexDirection: "column"}]}>
    <ImageBackground source={require('./Aquaman.jpg')} resizeMode="cover" style={styles.image}>
    {/* <ImageBackground source={image} resizeMode="cover" style={styles.image}> */}

      <View style={styles.container}>
        <StatusBar 
          animated={true}
          backgroundColor="#61dafb"></StatusBar>

          <Text style={styles.text}>Open up App.js to start working on your app!</Text>
          <View >
            <Button title="hello" onPress={() => Alert.alert('Button pressed')} style={styles.button}></Button>
          </View>
          <Modal style={styles.modal}>
            <Text style={styles.text}>Yo Yo Bitches!</Text> 
          </Modal>

      <View style={[styles.lowerContainor,{flexDirection: "row",}]}>
      {/* <View style={styles.lowerContainor}> */}
        <View style={[{backgroundColor:"skyblue"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/ios-filled/50/000000/info.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={styles.button2} title="IF" color="#696969"></Button>
        </View>
        <View style={[{backgroundColor:"skyblue"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/ios-filled/50/000000/add-bookmark.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="You" color="#696969" ></Button>
        </View>
        <View style={[{backgroundColor:"skyblue"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/ios-filled/50/000000/download-2--v2.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="Wanna" color="#696969" ></Button>
        </View>
        <View style={[{backgroundColor:"skyblue"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/ios-filled/50/000000/linkedin.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="Talk" color="#696969" ></Button>
        </View>
        <View style={[{backgroundColor:"skyblue"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/ios-filled/50/000000/picture.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="Then" color="#696969" ></Button>
        </View>
        <View style={[{backgroundColor:"skyblue"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/ios/50/000000/delete--v3.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="Talk" color="#696969" ></Button>
        </View>
        </View>
      </View>
    </ImageBackground>
    </View>


  );
}

const styles = StyleSheet.create({
  basecontainer:{
    flex: 1,
    // backgroundColor: 'skyblue', 
    backgroundColor:"#ff1493",
    alignItems: 'center',
    // justifyContent: 'center',
  },
  container: {
    flex:1,
    alignItems: 'center',
    // justifyContent: "space-around",
  },
  lowerContainor:{
    flex:1,
    position: "absolute",
    bottom:"5%",
    left:"30%",
    alignSelf:"stretch",
    // justifyContent: "space-around",
    alignItems:"center",
  },
  image: {
    flex: 1,
    color:"skyblue",
    alignSelf:"stretch",
    justifyContent: "center"
  },
  button:{
    alignSelf:"center",
    fontSize:40,
    color:"#7fff00",
    // height:"100%",
  },
  button2:{
    // backgroundColor:"#dc143c",
    color:"#dc143c",
    alignSelf:"center",
    backgroundColor:"#696969"
    // height:"100%",
  },
  text:{
    color: "white",
    fontSize: 30,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#323033"
  },
  modal:{
    color:"White",
    backgroundColor:"White",
    justifyContent:'center',
    alignSelf:"center",
  },
});
